import "./index.css"
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import { NavLink } from "react-router-dom";


const Menu = () => {
    return(

        <>
        <NavLink exact ctiveClassName="active_class" to='/'> MainPage </NavLink>
        <NavLink exact activeClassName="active_class" to='/secondpage'> Secondpage </NavLink>
        <br />
        <a href="/" >MainPage </a>
        <a href="/secondpage">Secondpage</a>

        </>
       
    );
}


export default Menu;
